import './mealItem.css'

const MealItem = (props)=>{
    return (
        <div className='meal'>
            <span style={{fontSize: 25, fontFamily: 'sans-serif', fontWeight: 'bold'}}>{props.name}</span>
            <span style={{fontFamily: 'cursive'}}>{props.description}</span>
            <span style={{color: 'maroon'}}>{props.price}</span>
        </div>
    );
}

export default MealItem
